import { Login } from "./sites/login/login"

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
    return (
        <div>
            <Login/>

            <Router>
                <Switch>
                    <Route path='/aaa' component={Login}/>
                </Switch>
            </Router>
        </div>


    );
}

export default App;
